('2404','2','8350','Whg. Laszlo',Null,'Apartment in 1. Meereslinie mit Hafenblick in Santa Ponsa zu verkaufen','33783','Das Apartment befindet sich direkt am Jachthafen von Santa Ponsa in der Gemeinde Calvia im Südwesten von Mallorca. Es hat einen fantastischen Meerblick und ist vom Parkdeck aus stufenlos zu begehen. Die Wohnung mit Penthouse Karakter hat ca 60m² Wohnfläche plus 30m² Terrasse. Sie bietet ein Wohn-Esszimmer mit Schlafniesche und Bad en suite, 1 Schlafzimmer, 1 Gäste WC (Waschmaschine, Trockner) und eine offenen Küche. Die kleine Wohnanlage hat 9 Wohnungen und ein Gemeinschaftspool','33784','569000','106','2015-11-24 11:40:08','106','2015-11-24 11:40:40',Null,'2523','121','1184',1,'1','0',Null,Null,Null,'33785',Null,'0','0','0',Null,'2015-11-24 11:46:26',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33786',Null,'33787',Null,'33788',Null,'33789',' 971 69 1837','33790','0',0,'0');
